import React, { useEffect, useMemo, useState } from 'react';

export default function AgeChecker() {
    var [age, setAge] = useState('Check Age')
    const checkAge = () => {
        setAge('21')
    }
    const person = {
        age: 29
      }
    useEffect(() => {
        if(person.age < 18){
            console.log("Under 18")
        }else if(person.age < 21){
            console.log("Under 21")
        }else{
            console.log("Ok to drink")
        }
    }, [])
    return(
        <>
        <button onClick={ checkAge() }>{age}</button>
        </>
    )
}
